import React, { useState, useEffect } from "react";
import { collection, addDoc, getDocs, query, where } from "firebase/firestore";
import { auth, db } from "../init-firebase";
import Swal from "sweetalert2";
import { onAuthStateChanged, signOut } from "firebase/auth";
import { Helmet } from "react-helmet";
import "../styles/home.css";
const HomePage = () => {
  const [bloodGroup, setBloodGroup] = useState("");
  
  const [name, setName] = useState("");
  const [age, setAge] = useState("");
  const [contactNo, setContactNo] = useState("");
  const [email, setEmail] = useState("");

  // Fetch user details on page load
 
  const DonateBlood = async (bloodGroup) => {
    onAuthStateChanged(auth, async (user) => {
      if (user) {
        const currentUserEmail = user.email.trim();
        console.log("Logged-in User Email:", currentUserEmail);
  
        try {
          // 1. Check if the user has already donated blood
          const donorQuery = query(
            collection(db, "BloodDonors"),
            where("UserEmail", "==", currentUserEmail)
          );
  
          const donorSnapshot = await getDocs(donorQuery);
  
          if (!donorSnapshot.empty) {
            // User has already donated
            Swal.fire("You have already donated blood!", "Thank you!", "info");
            return;
          }
  
          // 2. Fetch user details from SinupUser collection
          const userQuery = query(
            collection(db, "SinupUser"),
            where("UserEmail", "==", currentUserEmail)
          );
  
          const userSnapshot = await getDocs(userQuery);
  
          if (userSnapshot.empty) {
            // No user details found
            Swal.fire("User details not found in the database!", "", "error");
            return;
          }
  
          // Extract user details
          const userData = userSnapshot.docs[0].data();
          console.log("User details found:", userData);
  
          // 3. Validate blood group input
          if (!bloodGroup || bloodGroup === "-- Select Blood Group --") {
            Swal.fire("Please select a valid blood group!", "", "warning");
            return;
          }
  
          // 4. Add donation details to BloodDonors collection
          await addDoc(collection(db, "BloodDonors"), {
            Name: userData.Name,
            Age: userData.UserAge,
            Contact: userData.Contact,
            BloodGroup: bloodGroup,
            UserEmail: currentUserEmail,
            DonationDate: new Date().toISOString(),
          });
  
          Swal.fire(
            `Thank you ${userData.Name} for donating blood!`,
            "Your contribution can save lives.",
            "success"
          );
        } catch (error) {
          console.error("Error in blood donation process:", error.message);
          Swal.fire("Something went wrong. Please try again!", "", "error");
        }
      } else {
        // User not logged in
        Swal.fire("Please log in to donate blood!", "", "info");
      }
    });
  };
  // LogOut Function
  const LogOut = async () => {
    try {
      await signOut(auth);
      Swal.fire("Success", "You have been logged out.", "success");
      window.location.href = "/login";
    } catch (error) {
      console.error("Error during logout:", error);
      Swal.fire("Error", "Failed to log out. Please try again.", "error");
    }
  };

  return (
    <div className="homepage">
      <Helmet>
        <title>HomePage</title>
      </Helmet>
      <div className="navbar">
        <div className="navbar-brand">Blood Bank</div>
        <div className="navbar-links">
          <a href="/home">Home</a>
          <a href="/profile">Profile</a>
          <a href="/doner">Donors</a>
          <button onClick={LogOut}>Logout</button>
        </div>
      </div>

      <h1 className="title">Blood Bank</h1>
      <div className="form-container">
        <input type="text" placeholder="Name" value={name} onChange={(e)=>setName(e.target.value)} disabled />
        <input type="number" placeholder="Age" value={age} disabled />
        <input type="text" placeholder="Contact No" value={contactNo} disabled />
        <input
          type="text"
          placeholder="Enter Blood Group"
          value={bloodGroup}
          onChange={(e) => setBloodGroup(e.target.value)}
        />
        <div className="button-group">
          <button onClick={DonateBlood} className="btn donate-btn">
            Donate Blood
          </button>
        </div>
      </div>

      <footer className="footer">
        <div className="footer-container">
          <p>&copy; {new Date().getFullYear()} Blood Bank | All Rights Reserved</p>
        </div>
      </footer>
    </div>
  );
};

export default HomePage;
